import { Component } from '@angular/core';
import { CreateUserModel } from 'src/app/Models/Users/CreateUserModel';
import { UserServiceService } from 'src/app/services/Users/user-service.service';

@Component({
  selector: 'app-users-componet',
  templateUrl: './users-componet.component.html',
  styleUrls: ['./users-componet.component.scss']
})
export class UsersComponetComponent {
constructor(
  private userService : UserServiceService
){}
  CreateNewUser(){
    const user:CreateUserModel = {
      name: 'John',
      image: "0101010101010101", // Asigna la imagen base64 obtenida a la propiedad "image"
      lastName: 'Doe',
      secondLastName: 'Smith',
      dateOfBirth: new Date(2003, 3, 7),
      numberPhone: '123456789',
      document: '1234567890',
      email: 'john@example.com',
      password: 'password123',
      documentTypeId: 1,
      addressId: 0,
      rolId: 1,

    }
    this.userService.create(user)
    .subscribe(response =>{
      next:(response) =>{
        if(data){
          alert("Se ha enviado el código de verificación! "
          +"Por favor revice la bandeja de entrada de su correo");

        }else{
          alert("No se ha enviado el codigo de verificación, intetelo de nuevo");
        }
      },
      error:(err) =>{
        console.log(err)
        alert("Contraseña y/o Usuario invalido")
      }
    });
  }
}


